def DTWDistance(s1, s2,w):
    DTW={}

    w = np.array([w, np.abs(len(s1)-len(s2))]).max()

    for i in range(-1,len(s1)):
        for j in range(-1,len(s2)):
            DTW[(i, j)] = float('inf')
    DTW[(-1, -1)] = 0

    for i in range(len(s1)):
        for j in range(np.array([0, i-w]).max(), np.array([len(s2), i+w]).min()):
            dist= (s1[i]-s2[j])**2
            DTW[(i, j)] = dist + np.array([DTW[(i-1, j)],DTW[(i, j-1)], DTW[(i-1, j-1)]]).min()

    return np.sqrt(DTW[len(s1)-1, len(s2)-1]),DTW

